import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
const fname="noman";
const lname="sarwar"
const date= new Date();

ReactDOM.render(
  <>
 <h1> This is list of five netflix series </h1>
 <p>there are following five netflix series</p>
 <ol>  
 <li> thisn first</li>
 <li> thisn second</li>
 <li> thisn three</li>
 <li> thisn four</li>
 <li> thisn five</li>
  </ol>
  <h3>{`my first name is ${fname} and my last name is ${lname}`}</h3>
   <h3>{`today date is ${date.getDate()} and time is ${date.getHours()}:${date.getMinutes()}:${date.getSeconds()}`}</h3>
  </>
  ,
  document.getElementById('root')
);

